import React, { Component } from 'react';
import { Link } from "react-router-dom";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
  import { InputGroup, InputGroupAddon, InputGroupText, Input } from 'reactstrap';
  import { Button } from 'reactstrap';
  import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
  import { library } from '@fortawesome/fontawesome-svg-core';

library.add(fasFaStroopwafel, farFaStroopwafel);





  export default class Header extends Component {
    constructor(props) {
      super(props);
  
      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }
    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }
    render() {
      return (
        <div >
          <Navbar className="nav" color="none" light expand="md">
            <NavbarToggler onClick={this.toggle} />
            <Collapse isOpen={this.state.isOpen} navbar>
            <InputGroup className="inpotfrom">
        <Input placeholder="... ابحث عن درس" />
        <InputGroupAddon addonType="append">
        <Button color="secondary"> <FontAwesomeIcon icon="" /> </Button>
        </InputGroupAddon>
      </InputGroup>
              <Nav className="navv ml-auto" navbar>

              <NavItem className="navitem">
                  <Link to="/contact">تواصل معنا</Link>
                </NavItem>

                <NavItem className="navitem">
                   <Link to="/learn">تعلم </Link>
                </NavItem>
   
              <NavItem className="navitem">
                   <Link to="/learn">الصفحة الرئسية</Link>
                </NavItem>
                
               
               
              </Nav>
            </Collapse>
          </Navbar>
        </div>
      );
    }
  }
